import React from "react";

function Card(props) {
  const { type, profilePicture, name, researchInterests, educationLevel } =
    props;

  const handleClick = () => {
    // Implement your logic for the connect button click here
    alert(`Connecting with ${name}`);
  };
  return (
    <div className="card">
      <div className="card-header">
        <img src={profilePicture} alt="Profile" className="profile-picture" />
        <span>{type}</span>
      </div>
      <div className="card-body">
        <h2>{name}</h2>
        <p>
          <strong>Research Interests:</strong> {researchInterests}
        </p>
        <p>
          <strong>Education Level:</strong> {educationLevel}
        </p>
        <button onClick={handleClick}>Connect</button>
      </div>
    </div>
  );
}

export default Card;
